import {Component} from "react";
import React from "react";

interface ListOfImagesProps {
    photo: any;
    text: string;
}

function ListOfImages(props: ListOfImagesProps){
        return (
            <div>
                <img src={props.photo}/>
                <p>{props.text}</p>
            </div>
        );

}

export default ListOfImages;
